import React from 'react';
import Container from "react-bootstrap/Container";
import {Button, Card, Form, NavLink, Row} from "react-bootstrap";
import {REGISTRATION_ROUTE} from "../utils/consts";

const Auth = () => {
    return (
        <Container
            className="d-flex justify-content-center align-content-center"
            style={{height: window.innerHeight - 400}}
        >
            <Card style={{width: 600}} className="p-3">
                <h2 className="m-auto">ADMIN</h2>
                <Form className="d-flex flex-column">
                    <Form.Control
                        className="mt-2"
                        placeholder="enter email"
                    />
                    <Form.Control
                        className="mt-2"
                        placeholder="enter password"
                    />
                    <Row className="d-flex justify-content-between mt-3">
                        <div>
                            No account? <NavLink style={{color: "blue"}} to={REGISTRATION_ROUTE}>Register</NavLink>
                        </div>
                    <Button
                        className="mt-3"
                        variant={"outline-success"}>Login</Button>
                    </Row>
                </Form>
            </Card>
        </Container>
    );
};

export default Auth;
